{c_label}Angriffe pro Sekunde: {c_number}{s1}{/c}{/c}
{icon:bullet} Abhängig von der Waffengeschwindigkeit.
{icon:bullet} Kann durch Fertigkeiten und Gegenstände erhöht werden.

{c_label}Kritische Trefferchance: {c_number}{s1}{/c}{/c}
{icon:bullet} Kritische Treffer verursachen {c_number}{s2}{/c} Bonusschaden.
{icon:bullet} Kann durch Fertigkeiten und Gegenstände erhöht werden.

{c_label}Schildblockwert: {c_number}{s1}{/c}{/c}
{icon:bullet} Gibt die bei einem geblockten Angriff verhinderte Schadensmenge an.
{icon:bullet} Kann durch Fertigkeiten und Gegenstände erhöht werden.

{c_label}Maximales Leben: {c_number}{s2}{/c}{/c}
{icon:bullet} Ihr sterbt, sollte dieser Wert auf 0 sinken. 
{icon:bullet} Kann durch Fertigkeiten und Gegenstände erhöht werden.

{c_label}Leben pro getötetem Gegner: {c_number}{s1}{/c}{/c}
{icon:bullet} Regeneriert {c_number}{s2}{/c} Leben pro getötetem Gegner.
{icon:bullet} Kann durch Fertigkeiten und Gegenstände erhöht werden.

{c_label}Leben pro Treffer: {c_number}{s1}{/c}{/c}
{icon:bullet} Regeneriert {c_number}{s2}{/c} Leben pro getroffenem Gegner.
{icon:bullet} Kann durch Fertigkeiten und Gegenstände erhöht werden.

{c_label}Bonus auf kritischen Trefferschaden: {/c}{c_number}{s1}{/c}
{icon:bullet} Kann durch Fertigkeiten und Gegenstände erhöht werden.
{icon:bullet} Begrenzt auf {c_number}{s2}{/c} gegen andere Spieler.

{c_label}Bewegungsgeschwindigkeit:{/c} {c_number}{s1}{/c}
{icon:bullet} Ihr bewegt Euch mit {c_number}{s2}{/c} der Basisgeschwindigkeit.
{icon:bullet} Ihr könnt maximal {c_number}+25 %{/c} Bewegungsgeschwindigkeit durch Gegenstände erhalten.

{c_label}Erfahrungsbonus: {c_number}{s1}{/c}{/c}
{icon:bullet} Der Erfahrungsgewinn durch das Töten von Monstern ist um {c_number}{s2}{/c} erhöht.
{icon:bullet} Multiplikator: {c_number}{s3}{/c}. Dieser Multiplikator wird in Mehrspielerpartien verliehen.

{c_label}Dornen:{/c} {c_number}{s1}{/c}
{icon:bullet} Fügt Angreifern Schaden zu, wenn Ihr von direkten Angriffen getroffen werdet. Wird nicht von Schaden über Zeit ausgelöst.
{icon:bullet} Der verursachte Schaden wird durch einen Anteil Eures Primärattributs erhöht.

{c_label}Maximales Leben: {c_number}{s2}{/c}{/c}
{icon:bullet} Verliert ein Begleiter sämtliches Leben, wird er für kurze Zeit handlungsunfähig. 
{icon:bullet} Leben kann durch Fertigkeiten und Gegenstände erhöht werden.

{c_label}Maximales Leben: {c_number}{s2}{/c}{/c}
{icon:bullet} Verliert ein Begleiter sämtliches Leben, wird er für kurze Zeit handlungsunfähig. 
{icon:bullet} Leben kann durch Fertigkeiten und Gegenstände erhöht werden.

{c_label}Maximales Leben: {c_number}{s2}{/c}{/c}
{icon:bullet} Verliert ein Begleiter sämtliches Leben, wird er für kurze Zeit handlungsunfähig. 
{icon:bullet} Leben kann durch Fertigkeiten und Gegenstände erhöht werden.

{c_label}Flächenschaden:{/c} {c_number}{s1}{/c}
{icon:bullet} Alle Angriffe haben eine Chance von {c_number}{s2}{/c}, Gegnern im Umkreis von {c_number}{s4}{/c} Metern zusätzlich {c_number}{s3}{/c} des Schadens zuzufügen.
{icon:bullet} Verursachter Schaden kann durch Gegenstände erhöht werden.

{c_label}Schadensbonus ({s1}):{/c} {c_number}{s2}{/c}
{icon:bullet} Erhöht den Schaden, den Fertigkeiten dieses Elements verursachen.
{icon:bullet} Schaden ({s3}): {c_number}{s4}{/c}.

{c_label}Willenskraft:{/c} {c_number}{s1}{/c} {c_lightgray}(Durch Gegenstände: {c_blue}{s4}{/c}){/c}{s2}
{icon:bullet} Erhöht die erhaltene Heilung um {c_number}{s3}{/c}
{icon:bullet} Erhöht {c_important}{u}Überwältigungsschaden{/u}{/c_important} um {c_number}{s5}{/c}

{c_label}Schadensbarriere pro getötetem Gegner: {c_number}{s1}{/c}{/c}
{icon:bullet} Erhaltet eine Schadensbarriere, wenn Ihr einen Gegner tötet.
{icon:bullet} Die absorbierte Menge wird durch Gegenstände erhöht.

{c_label}Reduzierte Abklingzeit von Tränken: {c_number}{s1}{/c}{/c}
{icon:bullet} Reduziert die Abklingzeit Eurer Tränke.
{icon:bullet} Kann durch Gegenstände stärker reduziert werden.

{c_label}Überwältigungschance:{/c} {c_number}{s1}{/c}
{icon:bullet} Überwältigen verursacht Bonusschaden basierend auf der Summe Eures aktuellen Lebens und Eures gestählten Lebens.
{icon:bullet} Schaden über Zeit, passive Fertigkeiten und kanalisierte Fertigkeiten können nicht überwältigen.
